import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to the User Profile page
    // Try to find a link with text "Your Profile"
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });
    await profileLink.click();

    // Wait for the profile header to appear
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information
    const extractedData = {};

    // Get profile image URL
    extractedData.profileImage = await page.$eval('.profile-image', el => el.src);

    // Get full name
    extractedData.fullName = await page.$eval('.profile-info h2', el => el.textContent.trim());

    // Get username
    extractedData.username = await page.$eval('.profile-info .username', el => el.textContent.trim());

    // Get bio
    extractedData.bio = await page.$eval('.profile-info .bio', el => el.textContent.trim());

    // Get stats: Orders, Reviews, Seller Rating
    const stats = await page.$$eval('.profile-stats .stat', nodes =>
      nodes.map(node => ({
        label: node.querySelector('.stat-label')?.textContent.trim(),
        value: node.querySelector('.stat-number')?.textContent.trim()
      }))
    );
    for (const stat of stats) {
      if (stat.label && stat.value) {
        if (/order/i.test(stat.label)) extractedData.totalOrders = stat.value;
        if (/review/i.test(stat.label)) extractedData.totalReviews = stat.value;
        if (/seller/i.test(stat.label)) extractedData.sellerRating = stat.value;
      }
    }

    // Get Jun's products (titles)
    extractedData.junProducts = await page.$$eval(
      '.profile-sections .section:nth-child(1) .product-title',
      nodes => nodes.map(n => n.textContent.trim())
    );

    // Get Jun's recent reviews (titles and ratings)
    extractedData.junReviews = await page.$$eval(
      '.profile-sections .section:nth-child(2) .review-item',
      nodes => nodes.map(n => {
        const title = n.querySelector('.review-title')?.textContent.trim();
        const ratingStars = n.querySelector('.stars')?.textContent.trim();
        return { title, ratingStars };
      })
    );

    // Take screenshot of the profile stats section
    const profileStatsSection = await page.$('.profile-header');
    if (profileStatsSection) {
      await profileStatsSection.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_stats.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_profile_stats.png'));
    }

    return {
      success: true,
      action: "Harvested user profile information including image, name, username, bio, stats, Jun's products, and reviews.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
